const WishlistPage = () => {
  const [wishlistCourses, setWishlistCourses] = useState([]);
  const [loading, setLoading] = useState(true);

  const loadWishlist = () => {
    const savedIds = (JSON.parse(localStorage.getItem('wishlist')) || []).map(Number);

    if (savedIds.length === 0) {
      setWishlistCourses([]);
      setLoading(false);
      return;
    }

    const filtered = allCourses.filter(course => savedIds.includes(course.id));
    setWishlistCourses(filtered);
    setLoading(false);
  };

  useEffect(() => {
    loadWishlist();
  }, []);

  const handleRemove = (id) => {
    const updated = (JSON.parse(localStorage.getItem('wishlist')) || [])
      .map(Number)
      .filter((cid) => cid !== id);

    localStorage.setItem('wishlist', JSON.stringify(updated));
    setWishlistCourses((prev) => prev.filter((c) => c.id !== id));
  };

  return (
    <div className="pt-24 px-4 bg-gray-50 min-h-screen">
      <div className="max-w-7xl mx-auto">
        <h1 className="text-3xl font-bold text-gray-800 mb-6">💖 My Wishlist</h1>

        {loading ? (
          <p>Loading...</p>
        ) : wishlistCourses.length === 0 ? (
          <p className="text-gray-500">No saved courses found.</p>
        ) : (
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
            {wishlistCourses.map((course) => (
              <CourseCard
                key={course.id}
                course={course}
                onRemoveFromWishlist={handleRemove}
              />
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default WishlistPage;



